import classes from "./Cart.module.css" 
import Modal from "./Modal"

const Cart =  (props)=>{
  if(!props.showCart){
    return null
  }
  const cartItes = <ul className={classes['cart-itmes']}>{[{id:1, name:"test"}].map((item)=>{
    <li>{item.name}</li>
  })}</ul>
  return <Modal>
            {cartItmes}
            <div className={classes.total}>
              <span>test</span>
              <span>12</span>
            </div>
            <div className={classes.actions}>
              <button className={classes['button--alt']} onClick={props.cartHandler} >Close</button>
              <button className={classes.button}>Order</button>
            </div>
          </Modal>
        }

export default Cart
